function init() {
	this.mixer = new THREE.AnimationMixer( this );
	const clip = THREE.AnimationClip.findByName( this.animations, "Idle" );

	if ( clip ) {
		//console.log(clip);
		const action = this.mixer.clipAction( clip );
		action.play();
	}

}

function update(event) {
	this.mixer.update(event.delta / 1000);
}
